import React from 'react';
import { Container, Grow, Grid } from '@material-ui/core';

import Movies from '../Movies/Movies.js';

const Home = () => {

    return (
        <Grow in>
            <Container>
                <Grid container justify="space-between" alignItems="stretch" spacing={3}>
                    <Grid item xs={12} sm={7}>
                        <Movies />
                    </Grid>
        </Grid>
      </Container>
    </Grow>
    );
};

export default Home;
